The longest common subsequence (LCS) problem is a classic problem in computer science. The goal is to find the longest subsequence that is common to two input strings. This can be solved using dynamic programming. Here is a Python implementation of the LCS algorithm:
def lcs(x, y):
    # Initialize a 2D array to store the LCS lengths
    m = len(x) + 1
    n = len(y) + 1
    lcs = [[0] * n for _ in range(m)]

    # Fill in the LCS lengths
    for i in range(1, m):
        for j in range(1, n):
            if x[i - 1] == y[j - 1]:
                lcs[i][j] = lcs[i - 1][j - 1] + 1
            else:
                lcs[i][j] = max(lcs[i - 1][j], lcs[i][j - 1])

    # Find the LCS
    i, j = m - 1, n - 1
    lcs_str = ""
    while i > 0 and j > 0:
        if x[i - 1] == y[j - 1]:
            lcs_str += x[i - 1]
            i -= 1
            j -= 1
        elif lcs[i - 1][j] > lcs[i][j - 1]:
            i -= 1
        else:
            j -= 1

    return lcs_str[::-1]
```
